//			Date spaceOffsaleDate = java.sql.Date.valueOf(req.getParameter("spaceOffsaleDate").trim());

			//////////////////////////////////////////////////////////////////////////////////////////////////
			
			byte[] pic= null;
			Part parts = req.getPart("upfile");
			InputStream in = parts.getInputStream();
			pic=new byte[in.available()];
			in.read(pic);
			System.out.println("empServlet");
			in.close();
			
			
			MemberVO add = new MemberVO();
			add.setMember_id(memberId);
			add.setMember_account(memberAccount);
			add.setMember_password(memberPassword);
			add.setMember_name(memberName);
			add.setMember_nickname(memberNickname);
			add.setMember_email(memberEmail);
			add.setMember_photo(pic);
			add.setMember_phone(memberPhone);
			add.setMember_address(memberAddress);
			add.setMember_birth((java.sql.Date) memberBirth);
